import React from "react";
import { Router, Route, Routes } from "react-router-dom";
import HomePage from "./Pages/HomePage";

function App() {
  return (
    <Router>
    <Navbar />
    <Routes>
        <Route exact path='/' element={<HomePage />} />
    </Routes>
    </Router>
  );
}

export default App;
